import Header from "./components/header"

function hello(){
    //by default you can only return one parent jsx therefore u cant have for eg. <h1></h1> and <p>
    //to resolve this u can either contain all elements in a div or just use empty fragments <></>
return (<>
    <Header text="Feedback UI"/>
        <div>
        <h1>jhhj</h1>
        </div>
        </>
    )
    
}

export default hello
